import { Box } from "@mui/material";
import UserWidget from "scenes/widgets/UserWidget";

const HomePage = () => {
  const beige = "##f3f3f3";

  return (
    <Box bgcolor="beige">
      <UserWidget></UserWidget>
    </Box>
  );
};

export default HomePage;
